import React, { Component } from 'react';

export class Static extends Component {
  Home(d) {
    if (d === 1) {
      console.log('hello world');
    }
  }
  render() {
    return (
      <div>
        <button>
          <i
            className='fas fa-arrow-circle-up fa-2x '
            style={{
              position: 'fixed',
              top: '600px',
              right: '100px'
            }}
            onClick={() => this.Home(1)}
          ></i>
        </button>
      </div>
    );
  }
}

export default Static;
